#include"stdio.h"
#include <stdlib.h>

/**
 * Return an array of size *returnSize.
 * Note: The returned array must be malloced, assume caller calls free().
 */
int* productExceptSelf(int* nums, int numsSize, int* returnSize) {
    int i=0;
	int * ReturnArray=NULL;
	int ZeroNum = 0;
	int ZeroPosition = 0;
	long int  Product = 1;
	ReturnArray = (int*)malloc(numsSize*sizeof(int));
	//memset(ReturnArray,1,numsSize*sizeof(int));
	for (i=0;i<numsSize;i++){
		Product = Product*nums[i];
	}
	/*考虑数组中有元素为0的情况*/
	if (Product == 0){
		Product=1;
		/* 考虑是只有一个0还是多个0的情况*/
		for (i=0;i<numsSize;i++){
			if (nums[i] == 0){
				ZeroNum++;
				ZeroPosition = i;
			}
		}
		/*只有一个0的情况*/
		if (ZeroNum ==1){
			for (i=0;i<numsSize;i++){
				ReturnArray[i] = 0;
				if (i == ZeroPosition) continue;
				Product = Product*nums[i];
			}
			ReturnArray[ZeroPosition] = Product;
		}
		/*有多个0的情况*/
		else if (ZeroNum >1){
			for (i=0;i<numsSize;i++){
				ReturnArray[i] = 0;
			}
		}
	}
	/*数组中所有元素都不为0的情况*/
	else{
		for (i=0;i<numsSize;i++){
			ReturnArray[i] = Product/nums[i];
		}
	}
	
	* returnSize = numsSize;
	return ReturnArray;
}
